import React from 'react';

const Confirmation = () => {
  return (
    <div>
      <h2>Thank You!</h2>
      <p>Your onboarding form is completed. One of our team members will be in touch shortly.</p>
      <p>Please check your email for a copy of your submitted information and our terms and conditions.</p>
    </div>
  );
};

export default Confirmation;
